import { Link, Route, Routes } from "react-router-dom";

function NavBar() {
  return (
    <>
      <Link to="/">
        <img src={required("../public/logo.png")} alt="LOGO" />
      </Link>
      <Link to="/about">ABOUT</Link>
      <Link to="/contact">CONTACT</Link>
      <Link to="/cafe">CAFE`</Link>
      <Link to="/love-page">
        {" "}
        <img src={required("../public/heart.png")} alt="LOGO" />
      </Link>
      <Link to="/menu">
        {" "}
        <img src={required("../public/menu.png")} alt="LOGO" />
      </Link>
      <Routes>
        <Route path="/" element={<HomePage />} />
      </Routes>
    </>
  );
}
export default NavBar;
